using System;using HECSFramework.Core;using Newtonsoft.Json;using HECSFramework.Serialize;using Components;namespace HECSFramework.Serialize{	[JsonObject, Serializable]	public partial struct SoundVolumeComponentJSONResolver : IJSONResolver<SoundVolumeComponent,SoundVolumeComponentJSONResolver>	{		[JsonProperty("IsSoundOn")]		public bool IsSoundOn;		public SoundVolumeComponentJSONResolver In(ref SoundVolumeComponent soundvolumecomponent)		{			this.IsSoundOn = soundvolumecomponent.IsSoundOn;			return this;		}		public void Out(ref SoundVolumeComponent soundvolumecomponent)		{			soundvolumecomponent.IsSoundOn = this.IsSoundOn;		}	}}